exports.getUserByEmail = (obj,User) => {
	return new Promise((resolve, reject) => {
		//Do a case-insensitive search for email
		User.find({
			'email': new RegExp(`^${obj.email}$`, 'i')
		}, function (err, existingUsers) {
			if (!existingUsers || existingUsers.length === 0) {
				//User not found for email address
				reject();
			} else {
				resolve(existingUsers[0]);
			}
		});
	});
};
